style.css:
@-moz-document domain("lichess.org")
{
  .aclocks
  {
    position: absolute;
    right: -124px;
    width: 124px;
    top: calc(50% - 64px);
    font-family: 'Roboto Mono','Roboto';
    box-sizing: border-box;
    line-height: 30px;
  }

  .aclock
  {
    height: 30px;
    line-height: 30px;
    font-size: 25px;
    padding: 15px 10px;
  }
}
